mutation...{
        updateGroupFitClass(id: $id, title: $title, time: $time, daysIds: $daysArr) {
            id
            title
            time
            instructor {
                firstName
            }
            days {
                name
            }
        }
        addToInstructorsClasses(instructorInstructorId: $idGFI, classesGroupFitClassId: $id) {
            classesGroupFitClass {
                title
                days {
                    name
                }
                id
            }
            instructorInstructor {
                firstName
                id
            }
        }
    }

